import './App.css';

import {Layout, Button } from 'antd';


import Toolbar from './components/Navigation/Toolbar/Toolbar'
import BlogBuilder from './containers/Blog/BlogBuilder';
import ToolBar from './components/Navigation/Toolbar/Toolbar';

const { Header, Footer, Sider, Content } = Layout;
function App() {
  return (
    <div className="App">
      <Layout>
        <Header>
          <ToolBar/>
        </Header>
        <Layout>
          <Content style={{ padding: '0 10rem' }} className='Content'>
            <BlogBuilder/>

          </Content>

        </Layout>
        <Footer>Footer</Footer>
      </Layout>

    </div>
  );
}

export default App;
